  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2003 (NAEP 2003), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2003 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in various subject areas. The study
  was conducted using computer-based assessment of students. Students in grades 4,
  8, and 12 were sampled. The studyufffdufffds response rate was between 90 and 92
  percent. Key statistics produced from NAEP 2003 are results on subject-matter achievement,
  instructional experiences, and school environment for populations of students (e.g.,
  all fourth-graders) and groups within those populations (e.g., female students,
  Hispanic students).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
